# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Flask~Subclass
    - flask_sqlalchemy
    - Member[extension].Member[Flask]
  - - sqlalchemy.orm.Session~Subclass
    - flask_sqlalchemy
    - Member[extension].Member[Session]
  - - sqlalchemy.orm.Session~Subclass
    - flask_sqlalchemy
    - Member[session].Member[Session]
  - - sqlalchemy.orm.Session~Subclass
    - flask_sqlalchemy
    - Member[track_modifications].Member[Session]
